Award-winning director Michael Ninn assumes the throne of the NEW WAVE HOOKERS legacy, bravely going where Greg Dark couldn't -- and wouldn't go before. Wielding his now familiar formula of flashy special effects, MTV-style camera work, and ...    Full Descriptionbrooding art direction, Ninn throws in a bit of uncharacteristic slapstick and cartoon-style humor to create a whole new chapter in one of the most popular adult series ever made. With a plot too weird to describe here, NWH5 is a surreal saga populated by clowns and Japanese businessmen, talking televisions and mad scientists, monks and pimps, and other oddities of the Ninn psyche.
